import React, { useEffect } from "react";

function Home() {
  useEffect(() => {
      fetch('https://jsonplaceholder.typicode.com/todos/1')
      .then(res => res.json())
      .then(data => console.log(data))
  },[]);
  return (
    <div>
      <h1>Hello world</h1>
    </div>
  );
}

export default Home;
